import React from "react";

const courses = [
    {
        _id: "123",
        title: "CS5610"
    },
    {
        _id: "234",
        title: "CS4500"
    },
    {
        _id: "456",
        title: "CS4800"
    },
    {
        _id: "345",
        title: "CS3200"
    }
]
const CourseListComponents = ({instructor, term}) => {
    return (
        <div>
        <h1>Course List(for{instructor}) {term}</h1>
        <table className= "table">
            {
                courses.map( (item) =>
                    <tr><td>{item.title}</td></tr>
                )
            }
        </table>
        </div>
    )
}

export default CourseListComponents;
